export const styleSheet = () => ({
  root: {
    fontFamily: "Clash Display",
    fontStyle: "normal",
    fontWeight: 600,
    fontSize: "56px",
    lineHeight: "60px",
    letterSpacing: "-0.4px",
    color: "#23262F",
    margin: 0,
  },
});
